import React from "react";
import ProductDetails from "./ProductDetails";
 import {useParams} from "react-router-dom"

function Product() {
   const {categor} = useParams()
  console.log(type)
   const category = ProductDetails.filter(product => product.category === categor)
   console.log(category)
  const productElements = category.map((product) => (
    <div className="div-component" key={product.id}>
      <img src={product.image} alt="shirt" />
      <h4>Brand : Levi's</h4>
      <h4>Size : M</h4>
      <h4>price : {product.price}</h4>
    </div>
  ));

  return (
    <div className="div-shirt">
     {productElements}
    </div>
  );
}

export default Product;
